INSERT INTO `movie` VALUES (1,'Avatar','PG-13','18 Dec 2009','162 min','English','/resources/images/1.jpg','A paraplegic marine dispatched to the moon Pandora on a unique mission becomes torn between following his orders and protecting the world he feels is his home.','2009-12-18 00:00:00'),(2,'Pirates of the Caribbean: At World\'s End','PG-13','25 May 2007','169 min','English','/resources/images/2.jpg','Captain Barbossa, Will Turner and Elizabeth Swann must sail off the edge of the map, navigate treachery and betrayal, find Jack Sparrow, and make their final alliances for one last decisive battle.','2007-05-25 00:00:00'),(3,'Spectre','PG-13','06 Nov 2015','148 min','English','/resources/images/3.jpg','A cryptic message from Bond\'s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.','2015-11-06 00:00:00'),(4,'The Dark Knight Rises','PG-13','20 Jul 2012','164 min','English','/resources/images/4.jpg','Eight years after the Joker\'s reign of anarchy, the Dark Knight, with the help of the enigmatic Selina, is forced from his exile to save Gotham City, now on the edge of total annihilation, from the brutal guerrilla terrorist Bane.','2012-07-20 00:00:00'),(5,'Star Wars: Episode VII - The Force Awakens','N/A','18 Dec 2015','N/A','English','/resources/images/5.jpg','N/A','2015-12-18 00:00:00'),(6,'John Carter','PG-13','09 Mar 2012','132 min','English','/resources/images/6.jpg','Transported to Barsoom, a Civil War vet discovers a barren planet seemingly inhabited by 12-foot tall barbarians. Finding himself prisoner of these creatures, he escapes, only to encounter Woola and a princess in desperate need of a savior.','2012-03-09 00:00:00'),(7,'Spider-Man 3','PG-13','04 May 2007','139 min','English','/resources/images/7.jpg','A strange black entity from another world bonds with Peter Parker and causes inner turmoil as he contends with new villains, temptations, and revenge.','2007-05-04 00:00:00'),(8,'Tangled','PG','24 Nov 2010','100 min','English','/resources/images/8.jpg','The magically long-haired Rapunzel has spent her entire life in a tower, but now that a runaway thief has stumbled upon her, she is about to discover the world for the first time, and who she really is.','2010-11-24 00:00:00'),(9,'Avengers: Age of Ultron','PG-13','01 May 2015','141 min','English','/resources/images/9.jpg','When Tony Stark and Bruce Banner try to jump-start a dormant peacekeeping program called Ultron, things go horribly wrong and it\'s up to Earth\'s mightiest heroes to stop the villainous Ultron from enacting his terrible plan.','2015-05-01 00:00:00'),(10,'Harry Potter and the Half-Blood Prince','PG','15 Jul 2009','153 min','English','/resources/images/10.jpg','As Harry Potter begins his sixth year at Hogwarts, he discovers an old book marked as \"the property of the Half-Blood Prince\" and begins to learn more about Lord Voldemort\'s dark past.','2009-07-15 00:00:00'),(11,'Batman v Superman: Dawn of Justice','PG-13','25 Mar 2016','151 min','English','/resources/images/11.jpg','Fearing that the actions of Superman are left unchecked, Batman takes on the Man of Steel, while the world wrestles with what kind of a hero it really needs.','2016-03-25 00:00:00'),(12,'Superman Returns','PG-13','28 Jun 2006','154 min','English','/resources/images/12.jpg','Superman reappears after a long absence, but is challenged by an old foe who uses Kryptonian technology for world domination.','2006-06-28 00:00:00'),(13,'Quantum of Solace','PG-13','14 Nov 2008','106 min','English','/resources/images/13.jpg','James Bond descends into mystery as he tries to stop a mysterious organization from eliminating a country\'s most valuable resource.','2008-11-14 00:00:00'),(14,'Pirates of the Caribbean: Dead Man\'s Chest','PG-13','07 Jul 2006','151 min','English','/resources/images/14.jpg','Jack Sparrow races to recover the heart of Davy Jones to avoid enslaving his soul to Jones\' service, as other friends and foes seek the heart for their own agenda as well.','2006-07-07 00:00:00'),(15,'The Lone Ranger','PG-13','03 Jul 2013','150 min','English','/resources/images/15.jpg','Native American warrior Tonto recounts the untold tales that transformed John Reid, a man of the law, into a legend of justice.','2013-07-03 00:00:00'),(16,'Man of Steel','PG-13','14 Jun 2013','143 min','English','/resources/images/16.jpg','Clark Kent, one of the last of an extinguished race disguised as an unremarkable human, is forced to reveal his identity when Earth is invaded by an army of survivors who threaten to bring the planet to the brink of destruction.','2013-06-14 00:00:00'),(17,'The Chronicles of Narnia: Prince Caspian','PG','16 May 2008','150 min','English','/resources/images/17.jpg','The Pevensie siblings return to Narnia, where they are enlisted to once again help ward off an evil king and restore the rightful heir to the land\'s throne, Prince Caspian.','2008-05-16 00:00:00'),(18,'The Avengers','PG-13','04 May 2012','143 min','English','/resources/images/18.jpg','Earth\'s mightiest heroes must come together and learn to fight as a team if they are to stop the mischievous Loki and his alien army from enslaving humanity.','2012-05-04 00:00:00'),(19,'Pirates of the Caribbean: On Stranger Tides','PG-13','20 May 2011','136 min','English','/resources/images/19.jpg','Jack Sparrow and Barbossa embark on a quest to find the elusive fountain of youth, only to discover that Blackbeard and his daughter are after it too.','2011-05-20 00:00:00'),(20,'Men in Black 3','PG-13','25 May 2012','106 min','English','/resources/images/20.jpg','Agent J travels in time to M.I.B.\'s early days in 1969 to stop an alien from assassinating his friend Agent K and changing history.','2012-05-25 00:00:00'),(21,'The Hobbit: The Battle of the Five Armies','PG-13','17 Dec 2014','144 min','English','/resources/images/21.jpg','Bilbo and Company are forced to engage in a war against an array of combatants and keep the Lonely Mountain from falling into the hands of a rising darkness.','2014-12-17 00:00:00'),(22,'The Amazing Spider-Man','PG-13','03 Jul 2012','136 min','English','/resources/images/22.jpg','After Peter Parker is bitten by a genetically altered spider, he gains newfound, spider-like powers and ventures out to solve the mystery of his parent\'s mysterious death.','2012-07-03 00:00:00'),(23,'Robin Hood','PG-13','14 May 2010','140 min','English','/resources/images/23.jpg','In 12th century England, Robin and his band of marauders confront corruption in a local village and lead an uprising against the crown that will forever alter the balance of world power.','2010-05-14 00:00:00'),(24,'The Hobbit: The Desolation of Smaug','PG-13','13 Dec 2013','161 min','English','/resources/images/24.jpg','The dwarves, along with Bilbo Baggins and Gandalf the Grey, continue their quest to reclaim Erebor, their homeland, from Smaug. Bilbo Baggins is in possession of a mysterious and magical ring.','2013-12-13 00:00:00'),(25,'The Golden Compass','PG-13','07 Dec 2007','113 min','English','/resources/images/25.jpg','In a parallel universe, young Lyra Belacqua journeys to the far North to save her best friend and other kidnapped children from terrible experiments by a mysterious organization.','2007-12-07 00:00:00'),(26,'King Kong','PG-13','14 Dec 2005','187 min','English','/resources/images/26.jpg','In 1933 New York, an overly ambitious movie producer coerces his cast and hired ship crew to travel to the mysterious Skull Island, where they encounter Kong, a giant ape who is immediately smitten with leading lady Ann Darrow.','2005-12-14 00:00:00'),(27,'Titanic','PG-13','19 Dec 1997','194 min','English','/resources/images/27.jpg','A seventeen-year-old aristocrat falls in love with a kind but poor artist aboard the luxurious, ill-fated R.M.S. Titanic.','1997-12-19 00:00:00'),(28,'Captain America: Civil War','PG-13','06 May 2016','147 min','English','/resources/images/28.jpg','Political interference in the Avengers\' activities causes a rift between former allies Captain America and Iron Man.','2016-05-06 00:00:00'),(29,'Battleship','PG-13','18 May 2012','131 min','English','/resources/images/29.jpg','A fleet of ships is forced to do battle with an armada of unknown origins in order to discover and thwart their destructive goals.','2012-05-18 00:00:00'),(30,'Jurassic World','PG-13','12 Jun 2015','124 min','English','/resources/images/30.jpg','A new theme park, built on the original site of Jurassic Park, creates a genetically modified hybrid dinosaur, which escapes containment and goes on a killing spree.','2015-06-12 00:00:00'),(31,'Skyfall','PG-13','09 Nov 2012','143 min','English','/resources/images/31.jpg','Bond\'s loyalty to M is tested when her past comes back to haunt her. Whilst MI6 comes under attack, 007 must track down and destroy the threat, no matter how personal the cost.','2012-11-09 00:00:00'),(32,'Spider-Man 2','PG-13','30 Jun 2004','127 min','English','/resources/images/32.jpg','Peter Parker is beset with troubles in his failing personal life as he battles a brilliant scientist named Doctor Otto Octavius.','2004-06-30 00:00:00'),(33,'Iron Man 3','PG-13','03 May 2013','130 min','English','/resources/images/33.jpg','When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.','2013-05-03 00:00:00'),(34,'Alice in Wonderland','PG','05 Mar 2010','108 min','English','/resources/images/34.jpg','Nineteen-year-old Alice returns to the magical world from her childhood adventure, where she reunites with her old friends and learns of her true destiny: to end the Red Queen\'s reign of terror.','2010-03-05 00:00:00'),(35,'X-Men: The Last Stand','PG-13','26 May 2006','104 min','English','/resources/images/35.jpg','When a cure is found to treat mutations, lines are drawn amongst the X-Men, led by Professor Charles Xavier, and the Brotherhood, a band of powerful mutants organized under Xavier\'s former ally, Magneto.','2006-05-26 00:00:00'),(36,'Monsters University','G','21 Jun 2013','104 min','English','/resources/images/36.jpg','A look at the relationship between Mike and Sulley during their days at Monsters University -- when they weren\'t necessarily the best of friends.','2013-06-21 00:00:00'),(37,'Transformers: Revenge of the Fallen','PG-13','24 Jun 2009','150 min','English','/resources/images/37.jpg','Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.','2009-06-24 00:00:00'),(38,'Transformers: Age of Extinction','PG-13','27 Jun 2014','165 min','English','/resources/images/38.jpg','Autobots must escape sight from a bounty hunter who has taken control of the human serendipity: Unexpectedly, Optimus Prime and his remaining gang turn to a mechanic, his daughter, and her back street racing boyfriend for help.','2014-06-27 00:00:00'),(39,'Oz the Great and Powerful','PG','08 Mar 2013','130 min','English','/resources/images/39.jpg','A frustrated circus magician from Kansas is transported to a magical land called Oz, where he will have to fulfill a prophecy to become the king, and release the land from the Wicked Witches using his great (but fake) powers.','2013-03-08 00:00:00'),(40,'The Amazing Spider-Man 2','PG-13','02 May 2014','142 min','English','/resources/images/40.jpg','When New York is put under siege by Oscorp, it is up to Spider-Man to save the city he swore to protect as well as his loved ones.','2014-05-02 00:00:00'),(41,'TRON: Legacy','PG','17 Dec 2010','125 min','English','/resources/images/41.jpg','The son of a virtual world designer goes looking for his father and ends up inside the digital world that his father designed. He meets his father\'s corrupted creation and a unique ally who was born inside the digital world.','2010-12-17 00:00:00'),(42,'Cars 2','G','24 Jun 2011','106 min','English','/resources/images/42.jpg','Star race car Lightning McQueen and his pal Mater head overseas to compete in the World Grand Prix race. But the road to the championship becomes rocky as Mater gets caught up in an intriguing adventure of his own: international espionage.','2011-06-24 00:00:00'),(43,'Green Lantern','PG-13','17 Jun 2011','114 min','English','/resources/images/43.jpg','Reckless test pilot Hal Jordan is granted an alien ring that bestows him with otherworldly powers that inducts him into an intergalactic police force, the Green Lantern Corps.','2011-06-17 00:00:00'),(44,'Toy Story 3','G','18 Jun 2010','103 min','English','/resources/images/44.jpg','The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it\'s up to Woody to convince the other toys that they weren\'t abandoned and to return home.','2010-06-18 00:00:00'),(45,'Terminator Salvation','PG-13','21 May 2009','115 min','English','/resources/images/45.jpg','In 2018, a mysterious new weapon in the war against the machines, half-human and half-machine, comes to John Connor on the eve of a resistance attack on Skynet. But whose side is he on, and can he be trusted?','2009-05-21 00:00:00'),(46,'Furious 7','PG-13','03 Apr 2015','137 min','English','/resources/images/46.jpg','Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.','2015-04-03 00:00:00'),(47,'World War Z','PG-13','21 Jun 2013','116 min','English','/resources/images/47.jpg','Former United Nations employee Gerry Lane traverses the world in a race against time to stop the Zombie pandemic that is toppling armies and governments, and threatening to destroy humanity itself.','2013-06-21 00:00:00'),(48,'X-Men: Days of Future Past','PG-13','23 May 2014','132 min','English','/resources/images/48.jpg','The X-Men send Wolverine to the past in a desperate effort to change history and prevent an event that results in doom for both humans and mutants.','2014-05-23 00:00:00'),(49,'Star Trek Into Darkness','PG-13','16 May 2013','132 min','English','/resources/images/49.jpg','After the crew of the Enterprise find an unstoppable force of terror from within their own organization, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction.','2013-05-16 00:00:00'),(50,'Jack the Giant Slayer','PG-13','01 Mar 2013','114 min','English','/resources/images/50.jpg','The ancient war between humans and a race of giants is reignited when Jack, a young farmhand fighting for a kingdom and the love of a princess, opens a gateway between the two worlds.','2013-03-01 00:00:00'),(51,'The Great Gatsby','PG-13','10 May 2013','143 min','English','/resources/images/51.jpg','A writer and wall street trader, Nick, finds himself drawn to the past and lifestyle of his millionaire neighbor, Jay Gatsby.','2013-05-10 00:00:00'),(52,'Prince of Persia: The Sands of Time','PG-13','28 May 2010','116 min','English','/resources/images/52.jpg','A young fugitive prince and princess must stop a villain who unknowingly threatens to destroy the world with a special dagger that enables the magic sand inside to reverse time.','2010-05-28 00:00:00'),(53,'Pacific Rim','PG-13','12 Jul 2013','131 min','English','/resources/images/53.jpg','As a war between humankind and monstrous sea creatures wages on, a former pilot and a trainee are paired up to drive a seemingly obsolete special weapon in a desperate effort to save the world from the apocalypse.','2013-07-12 00:00:00'),(54,'Transformers: Dark of the Moon','PG-13','29 Jun 2011','154 min','English','/resources/images/54.jpg','The Autobots learn of a Cybertronian spacecraft hidden on the moon, and race against the Decepticons to reach it and to learn its secrets.','2011-06-29 00:00:00'),(55,'Indiana Jones and the Kingdom of the Crystal Skull','PG-13','22 May 2008','122 min','English','/res