:00'),(1571,'Going the Distance','R','03 Sep 2010','102 min','English','/resources/images/1571.jpg','A romantic comedy centered on a guy and a gal who try to keep their love alive as they shuttle back and forth between New York and San Francisco to see one another.','2010-09-03 00:00:00'),(1572,'Mr. Holland\'s Opus','PG','19 Jan 1996','143 min','English','/resources/images/1572.jpg','A frustrated composer finds fulfillment as a high school music teacher.','1996-01-19 00:00:00'),(1573,'Criminal','R','15 Apr 2016','113 min','English','/resources/images/1573.jpg','In a last-ditch effort to stop a diabolical plot, a dead CIA operative\'s memories, secrets, and skills are implanted into a death-row inmate in hopes that he will complete the operative\'s mission.','2016-04-15 00:00:00'),(1574,'Out of Africa','PG','20 Dec 1985','161 min','English','/resources/images/1574.jpg','In 20th-century colonial Kenya, a Danish baroness/plantation owner has a passionate love affair with a free-spirited big-game hunter.','1985-12-20 00:00:00'),(1575,'Flight','R','02 Nov 2012','138 min','English','/resources/images/1575.jpg','An airline pilot saves almost all his passengers on his malfunctioning airliner which eventually crashed, but an investigation into the accident reveals something troubling.','2012-11-02 00:00:00'),(1576,'Moonraker','PG','29 Jun 1979','126 min','English','/resources/images/1576.jpg','James Bond investigates the mid-air theft of a space shuttle and discovers a plot to commit global genocide.','1979-06-29 00:00:00'),(1577,'The Grand Budapest Hotel','R','28 Mar 2014','99 min','English','/resources/images/1577.jpg','The adventures of Gustave H, a legendary concierge at a famous hotel from the fictional Republic of Zubrowka between the first and second World Wars, and Zero Moustafa, the lobby boy who becomes his most trusted friend.','2014-03-28 00:00:00'),(1578,'Hearts in Atlantis','PG-13','28 Sep 2001','101 min','English','/resources/images/1578.jpg','A widowed mother and her son change when a mysterious stranger enters their lives.','2001-09-28 00:00:00'),(1579,'Arachnophobia','PG-13','18 Jul 1990','103 min','English','/resources/images/1579.jpg','A species of South American killer spider hitches a lift to the U.S. in a coffin and starts to breed and kill.','1990-07-18 00:00:00'),(1580,'Frequency','PG-13','28 Apr 2000','118 min','English','/resources/images/1580.jpg','An accidental cross-time radio link connects father and son across 30 years. The son tries to save his father\'s life, but then must fix the consequences.','2000-04-28 00:00:00'),(1581,'Ghostbusters','PG-13','15 Jul 2016','116 min','English','/resources/images/1581.jpg','Following a ghost invasion of Manhattan, paranormal enthusiasts Erin Gilbert and Abby Yates, nuclear engineer Jillian Holtzmann, and subway worker Patty Tolan band together to stop the otherworldly threat.','2016-07-15 00:00:00'),(1582,'Vacation','R','29 Jul 2015','99 min','English','/resources/images/1582.jpg','Rusty Griswold takes his own family on a road trip to \"Walley World\" in order to spice things up with his wife and reconnect with his sons.','2015-07-29 00:00:00'),(1583,'Get Shorty','R','20 Oct 1995','105 min','English','/resources/images/1583.jpg','A mobster travels to Hollywood to collect a debt and discovers that the movie business is much the same as his current job.','1995-10-20 00:00:00'),(1584,'Chicago','PG-13','24 Jan 2003','113 min','English','/resources/images/1584.jpg','Murderesses Velma Kelly and Roxie Hart find themselves on death row together and fight for the fame that will keep them from the gallows in 1920s Chicago.','2003-01-24 00:00:00'),(1585,'Big Daddy','PG-13','25 Jun 1999','93 min','English','/resources/images/1585.jpg','A lazy law school grad adopts a kid to impress his girlfriend, but everything doesn\'t go as planned and he becomes the unlikely foster father.','1999-06-25 00:00:00'),(1586,'American Pie 2','R','10 Aug 2001','108 min','English','/resources/images/1586.jpg','In this sequel to the hit comedy American Pie (1999), the high school students are now in college. These close friends decide to meet up at the beach house for some fun.','2001-08-10 00:00:00'),(1587,'Toy Story','G','22 Nov 1995','81 min','English','/resources/images/1587.jpg','A cowboy doll is profoundly threatened and jealous when a new spaceman figure supplants him as top toy in a boy\'s room.','1995-11-22 00:00:00'),(1588,'Speed','R','10 Jun 1994','116 min','English','/resources/images/1588.jpg','A young police officer must prevent a bomb exploding aboard a city bus by keeping its speed above 50 mph.','1994-06-10 00:00:00'),(1589,'The Vow','PG-13','10 Feb 2012','104 min','English','/resources/images/1589.jpg','A car accident puts Paige in a coma, and when she wakes up with severe memory loss, her husband Leo works to win her heart again.','2012-02-10 00:00:00'),(1590,'Extraordinary Measures','PG','22 Jan 2010','106 min','English','/resources/images/1590.jpg','A drama centered on the efforts of John and Aileen Crowley to find a researcher who might have a cure for their two children\'s rare genetic disorder.','2010-01-22 00:00:00'),(1591,'Remember the Titans','PG','29 Sep 2000','113 min','English','/resources/images/1591.jpg','The true story of a newly appointed African-American coach and his high school team on their first season as a racially integrated unit.','2000-09-29 00:00:00'),(1592,'The Hunt for Red October','PG','02 Mar 1990','135 min','English','/resources/images/1592.jpg','In November 1984, the Soviet Union\'s best submarine captain in their newest sub violates orders and heads for the USA. Is he trying to defect or to start a war?','1990-03-02 00:00:00'),(1593,'Lee Daniels\' The Butler','PG-13','16 Aug 2013','132 min','English','/resources/images/1593.jpg','As Cecil Gaines serves eight presidents during his tenure as a butler at the White House, the civil rights movement, Vietnam, and other major events affect this man\'s life, family, and American society.','2013-08-16 00:00:00'),(1594,'Dodgeball: A True Underdog Story','PG-13','18 Jun 2004','92 min','English','/resources/images/1594.jpg','A group of misfits enter a Las Vegas dodgeball tournament in order to save their cherished local gym from the onslaught of a corporate health fitness chain.','2004-06-18 00:00:00'),(1595,'The Addams Family','PG-13','22 Nov 1991','99 min','English','/resources/images/1595.jpg','Con artists plan to fleece an eccentric family using an accomplice who claims to be their long-lost uncle.','1991-11-22 00:00:00'),(1596,'Ace Ventura: When Nature Calls','PG-13','10 Nov 1995','90 min','English','/resources/images/1596.jpg','Ace Ventura, Pet Detective, returns from a spiritual quest to investigate the disappearance of a rare white bat, the sacred animal of a tribe in Africa.','1995-11-10 00:00:00'),(1597,'The Princess Diaries','G','03 Aug 2001','111 min','English','/resources/images/1597.jpg','Mia Thermopolis has just found out that she is the heir apparent to the throne of Genovia. With her friends Lilly and Michael Moscovitz in tow, she tries to navigate through the rest of her sixteenth year.','2001-08-03 00:00:00'),(1598,'The First Wives Club','PG','20 Sep 1996','103 min','English','/resources/images/1598.jpg','Reunited by the death of a college friend, three divorced women seek revenge on the husbands who left them for younger women.','1996-09-20 00:00:00'),(1599,'Se7en','R','22 Sep 1995','127 min','English','/resources/images/1599.jpg','Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his motives.','1995-09-22 00:00:00'),(1600,'District 9','R','14 Aug 2009','112 min','English','/resources/images/1600.jpg','An extraterrestrial race forced to live in slum-like conditions on Earth suddenly finds a kindred spirit in a government agent who is exposed to their biotechnology.','2009-08-14 00:00:00'),(1601,'The SpongeBob SquarePants Movie','PG','19 Nov 2004','87 min','English','/re